# Function implementation
def extract_events(inputs: Dict[str, Any]) -> str:
    import json

    input_text = inputs["input_text"]
    entities = json.loads(inputs["entities"])

    events = []
    event_id = 1

    for entity in entities:
        if entity["category"] == "Drug/Substance":
            event = {
                "id": event_id,
                "type": "Drug/Substance",
                "name": entity["entity"]
            }
            event_id += 1
            events.append(event)

    # Adding temporal constraints to the last event
    for event in events:
        event["temporal"] = {
            "start": {
                "number": 21,
                "unit": "days"
            },
            "reference_event": "first dose of ABBV-368"
        }

    return json.dumps(events, indent=4)

# Output
