                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            },
            "end":{
                "number": int, \\ the number of days/months/years/etc after the reference event
                "unit": str, \\ the unit of the temporal, in ["days", "weeks", "months", "years"]
            },
            "reference_event": int, \\ the reference event id for the start and end window
        }
    }}

    IMPORTANT: 
    - for all the events, the fields 'id', 'type', 'name' are mandatory, the other fields are optional and should be included only if they are present in the input text.
    - for all the events, the field 'type' must be one of the following: 'Condition', 'Observation', 'Procedure/Device', 'Drug/Substance'.

    The function should return a syntactically correct JSON format string that contains a list of the extracted events, each event should be one of the above formats.
    The output is wrapped within  ```json and ``` tags, for example:
    ```json
    [
        {
