            "type":"Observation", \\ the type of the entity
            "name": "age", \\ the name of the observation
            "value":{
                "range": {
                    "lower_bound": float, \\ the lower bound of the age value
                    "upper_bound": float, \\ the upper bound of the age value
                    "unit": str, \\ the unit of the age value
                }},
        },
        ... \\ other events
    ]
    ```

    Returns:
    - str: a JSON format string that contains a list of the extracted events, wrapped by ```json and ``` tags
    """
    input_text = inputs["input_text"]
    entities = inputs["entities"]

    events = []
    event_id = 1

    for entity in entities:
        if entity["category"] == "Observation":
            event = {
                "id": event_id,
                "type": "Observation",
                "name": entity["entity"]
            }
            event_id += 1
            events.append(event)
        elif entity["category"] == "Measurement":
            if events and events[-1]["type"] == "Observation":
                measurement = entity["entity"]
                if ">" in measurement:
                    operator = "at least"
                    value = float(measurement.split(">")[1].strip().split()[0])
                    unit = measurement.split(">")[1].strip().split()[1]
                elif "<" in measurement:
                    operator = "at most"
                    value = float(measurement.split("<")[1].strip().split()[0])
                    unit = measurement.split("<")[1].strip().split()[1]
                else:
                    operator = "exactly"
                    value = float(measurement.split()[0])
                    unit = measurement.split()[1]

                events[-1]["value"] = {
                    "range": {
                        "lower_bound": value if operator == "at least" else None,
                        "upper_bound": value if operator == "at most" else None,
                        "unit": unit
                    }
                }

    return f"""```json
{json.dumps(events, indent=4)}
```"""
