def extract_events(inputs: Dict[str, Any]) -> str:
    """
    This function is used to identify and extract structured events and attributes related to the specified entities from the input text.
    The entities, along with their types and names, have been identified in a previous step and are provided for reference.

    The function takes a dictionary of `inputs` as an argument, which contains the following keys:
    - 'input_text': the input eligibility criteria in text format
    - 'entities': a list of entities, each containing the type and name of an entity identified in the input text
        e.g., ["Condition: Type 2 diabetes mellitus", "Drug/Substance: Metformin", "Measurement: Serum creatinine", "Procedure/Device: Chemotherapy", "Observation: Smoking", "Observation: 30 to 75 years old", ...]

    The function should return a list of dictionaries, each containing the extracted events and attributes for the specified entities.
    - Event entity types include: `Condition`, `Observation`, `Procedure/Device`, `Drug/Substance`.
    - Attribute entities include: `Measurement`, `Temporal Constraints`, `Qualifiers/Modifiers`.

    The formats of the target extracted events are as follows:


    Observation:
    {
        "id": int, \\ the unique identifier of the event, starting from 1 to N
        "type":"Observation",
        "name": str, \\ the name of the observation
        "occurrence": {
            "operator": str, \\ the operator of the occurrence, in ["at least", "at most", "exactly"]
            "number": int, \\ the number of occurrence
        },
